import React from 'react'
import { Form, Input } from 'antd';
import { TweetButton } from "./style/PostFormStyle.js";

const { TextArea } = Input;


function PostForm() {
    return (
        <>
            <TextArea
                rows={4}
                value=""
                onChange=""
                maxLength={140}
                placeholder="어떤 신기한 일이 있었나요?"
            />
            <input type="file" multiple hidden />
            <TweetButton primary >이미지 업로드</TweetButton>
            <TweetButton primary right>Tweet</TweetButton>
        </>
    )
}

export default PostForm
